import React from 'react';
import ToDoView from "./to-do-view";
import ToDoTask from "./to-do-task";

const ToDoItem = ({label}) => {
const truely = label
    if(truely){
        return (
            <li>
                <ToDoView/>
                <ToDoTask/>
            </li>

        );
    }
    else {
        return (
            <li>
                <ToDoView/>
               
            </li>

        );
    }
};

export default ToDoItem;
